import React from "react";
import Button from 'react-bootstrap/Button'


function LoginPage() {



    return (
        <div className="">
            <div className="container" style={{ maxWidth: '400px' }}>
                <div className="row">
                    <div className="col-lg d-flex flex-col justify-content-center align-items-center" style={{ backgroundColor: 'red' }}>
                        <div className="">Welcome to the SLVSH Bracket.</div>
                        <Button>Login</Button>
                        <div className="">or</div>
                        <div className="">Create Account</div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default LoginPage;
